import React from "react";
import Logo from "./components/Logo";
import Dropdown from "./Dropdown";

function App() {
    return (
        <>
        <div>  
        <Logo />
          
            <nav>
                <li>Home</li>
                <li>Gov.Scemes</li>
                <li>Gov.Info</li>
                <li>NewsLetter</li>
                <li>Login/SignUp</li>
                <li>FAQS</li>
                <li>App Guide</li>
            </nav> 
        </div>
        </>
    )
}
export default App;
